def parse_tags(html):
    # 创建 BeautifulSoup 对象
    soup = BeautifulSoup(html, "html.parser")

    # 找到所有包含标签的 div 元素
    tag_divs = soup.find_all(
        "div",
        class_="inline-flex flex-nowrap ml-0.5 gap-0.5 cursor-pointer max-w-[calc(100%-16px)]",
    )

    # 存储标签和计数的列表
    tags = []

    for div in tag_divs:
        # 找到标签名称和计数
        tag_span = div.find("span", class_="truncate dark:opacity-80")
        count_span = div.find("span", class_="opacity-60 shrink-0")

        if tag_span:
            tag_name = tag_span.text
            # 提取计数，如果存在的话
            count = count_span.text.strip("()") if count_span else "0"
            tags.append(
                {"name": tag_name, "count": int(count) if count.isdigit() else 0}
            )

    return tags


